import React from "react";
import './nav.css';

const NavBar = () => {
  return (
    <>
      <div className="container-fluid">
      <h2 className="navbar-h2">Hoteles</h2>
      </div>
      <div className="container-fluid">
        <input
          placeholder="Search"
          className="form-control-lg navbar"
        />
      </div>
    </>
  );
};

export default NavBar;
